iterations.yara_rule:
rule Bypass_Sample
{
    meta:
        description = "Evasion bypass patterns targeting specific address points"
        cape_options = "bp0=$pattern0+0,action0=skip,bp1=$pattern1+0,action1=skip,bp2=$pattern2+0,action2=skip,count=0"

    strings:
        $pattern0 = { 8B FF ?? 55 ?? FF 75 08 E8 C8 FF FF FF 59 FF 75 08 FF 15 AC B0 41 00 } 
        $pattern1 = { 6A 5A 8B EC E8 07 26 00 00 C1 E8 A8 01 75 10 FF 75 08 FF 15 3C E1 08 00 }
        $pattern2 = { 8B FF 55 8B EC FF 75 08 E8 C8 FF FF FF 59 FF 75 08 FF 15 40 E1 08 00 }

    condition:
        any of them
}

rule Bypass_Sample_Evolved
{
    meta:
